import { NavigationContainer } from "@react-navigation/native";
import React from "react";
import DrawerNavigator from "./src/navigations/DrawerNavigator";
import appStyles from "./app.css";

export default function App() {
  return (
    <div style={appStyles}>
      <NavigationContainer>
        <DrawerNavigator />
      </NavigationContainer>
    </div>
  );
}
